define('text!components/breadcrumbs.html', ['module'], function(module) { module.exports = "<template>\n  <style>\n    .tab-container {\n      height: 320px;\n    }\n\n  </style>\n  <ui-page page-title=\"Breadcrumbs\">\n    <ui-content padded scroll>\n      <ui-container>\n        <h5 class=\"section-title\">With Tabs</h5>\n        <div class=\"tab-container\">\n          <ui-panel>\n            <ui-breadcrumb change.trigger=\"changeTab($event)\">\n              <ui-crumb repeat.for=\"c of activeTab+1\" id.bind=\"c\">${crumbs[c]}</ui-crumb>\n            </ui-breadcrumb>\n            <ui-breadcrumb secondary change.trigger=\"changeTab($event)\">\n              <ui-crumb repeat.for=\"c of activeTab+1\" id.bind=\"c\">${crumbs[c]}</ui-crumb>\n            </ui-breadcrumb>\n            <ui-tab-panel active-tab.bind=\"activeTab\" notabs height=\"10em\" noborder>\n              <ui-tab padded scroll>\n                <h1>Personal Information...</h1>\n              </ui-tab>\n              <ui-tab padded scroll>\n                <h1>Shipping Information...</h1>\n              </ui-tab>\n              <ui-tab padded scroll>\n                <h1>Payment Information...</h1>\n              </ui-tab>\n              <ui-tab padded scroll>\n                <h1>Agreement...</h1>\n                <ui-checkbox checked.bind=\"agree\">Agree to terms</ui-checkbox>\n              </ui-tab>\n            </ui-tab-panel>\n            <ui-toolbar light>\n              <ui-button if.bind=\"activeTab!=0\" click.trigger=\"prev()\">Previous</ui-button>\n              <ui-button if.bind=\"activeTab+1!=crumbs.length\" click.trigger=\"next()\">Next</ui-button>\n              <ui-button secondary if.bind=\"activeTab+1==crumbs.length\" disabled.bind=\"!agree\">Finish</ui-button>\n            </ui-toolbar>\n          </ui-panel>\n        </div>\n        <br/><br/>\n      </ui-container>\n    </ui-content>\n  </ui-page>\n</template>"; });
